import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from '@react-navigation/native-stack';

import "./style.css";

import ChatComponent from "./src/components/ChatComponent";
import Chat from "./src/components/chat/Chat";
import SearchFriends from "./src/components/searchFriends/SearchFriends";
import Message from "./src/components/message/Message";
import TuyChonBanBe from "./src/components/TuyChonBanBe";
import TuyChon from "./src/components/TuyChon";
import Profile from "./src/components/friendProfile/Profile";
import ThemBanQR from "./src/components/AddFriends";
import ChonThanhVienNhom from "./src/components/CreateGroup";



const Stack = createNativeStackNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="ChatComponent">
        <Stack.Screen name="ChatComponent" component={ChatComponent}
        options={{ headerShown: false }}
        />        
        <Stack.Screen name="ChatContent" component={Chat} />       
        <Stack.Screen name="SearchFriends" component={SearchFriends} />       
        <Stack.Screen name="Message" component={Message} />       
        <Stack.Screen name="TuyChonBanBe" component={TuyChonBanBe} />       
        <Stack.Screen name="TuyChon" component={TuyChon} />       
        <Stack.Screen name="Profile" component={Profile} />       
        <Stack.Screen name="AddFriends" component={AddFriends} />       
        <Stack.Screen name="CreateGroup" component={CreateGroup} />       
      </Stack.Navigator>
    </NavigationContainer>
  );
}
